INSERT INTO `recipe` (`id`, `name`, `subtitle`, `user_id`, `text`, `image_base64`) VALUES
(1, 'Nadýchaný hrnečkový perník', 'Perník patří mezi velmi jednoduché buchty a je rychlý na přípravu. Navíc se dá připravit osvědčenou hrnkovou metodou, proto nepotřebujete váhu. Potřený marmeládou a politý čokoládou - to je přesně ten, který nám pekly naše babičky k víkendové snídani.', 1, '2 hrnky hladké mouky\n\n1 hrnek cukru\n\n1 hrnek mléka\n\n1/2 hrnku oleje\n\n1 vejce\n\n1 kypřicí prášek do perníku\n\n1 vanilkový cukr\n\n2 lžíce kakaa\n\nnasekané ořechy (možno vynechat)\n\nNejprve připravíme hluboký plech, vymažeme ho tukem a vysypeme hrubou moukou. Místo toho můžeme plech pouze vyložit papírem na pečení.\nJak připravit plech na pečení\n\n\nDo mísy vsypeme mouku, cukr, vanilkový cukr, kakao, kypřicí prášek do perníku a promícháme. Přidáme mléko, olej, vejce a opět promícháme. Do těsta můžeme přidat nasekané ořechy.\n\nTěsto vylijeme na připravený plech a vložíme do středně předehřáté trouby.\n\nPečeme zhruba 20 minut při teplotě 170 °C, řídíme se zkušeností s vlastní troubou.\n\nHotový perník potřeme marmeládou, polijeme čokoládou a posypeme kokosem.', 'data:image/webp;base64,');
INSERT INTO `recipe` (`id`, `name`, `subtitle`, `user_id`, `text`, `image_base64`) VALUES
(2, 'Klasický hospodský guláš (vídeňský)', 'Tradiční guláš z hovězí kližky a poctivé dávky cibule, který nepotřebuje zahustit moukou. Vyžaduje více času, ale odvděčí se plnou chutí a rozpadajícím se masem. S knedlíkem a pár kolečky syrové cibule patří mezi hospodskou klasiku.', 1, '500 g hovězího masa na guláš (nejlépe kližka)\n\n500 g cibule\n\n3 lžíce sádla\n\n2 lžíce sladké mleté papriky\n\n4 stroužky česneku\n\n1 lžička mletého nebo drceného kmínu\n\n1 malý rajčatový protlak\n\nmletý černý pepř\n\nsůl\n\n1 lžíce majoránky\n\nvoda na podlévání\n\ncibule na ozdobu\n\nCibuli oloupeme a nakrájíme nadrobno. V kastrole rozehřejeme sádlo a cibuli na něm restujeme \nGuláš stále hlídáme a občas mícháme. Přiléváme vodu po menších částech, protože jak již bylo řečeno, měl by se přichytávat, ovšem nikoli připalovat.\n\nPo cca hodině a půl maso ochutnáme a pokud je měkké, přidáme v dlaních rozemnutou majoránku a povaříme ještě 10 minut.\n\nGuláš nemusíme (a ani bychom neměli) zahušťovat, postaral se o to rozvařený cibulový základ. Jediné povolené zahušťovadlo je v případě potřeby chlebová strouhanka.\nPodáváme posypané čerstvě nakrájenou cibulí, nejlépe s houskovým knedlíkem, případně s bramboráčky nebo těstovinami.', 'data:image/webp;base64,');
INSERT INTO `recipe` (`id`, `name`, `subtitle`, `user_id`, `text`, `image_base64`) VALUES
(3, 'Brambory zapečené s růžičkovou kapustou', 'Růžičková kapusta má svoji sezónu v zimě. Pokud ji pěstujete, tak si můžete jít čerstvou natrhat ze stonku. Zelené kuličky pak přidejte k bramborám, doplňte šunkou, vajíčky a sýrem a zapečte. Rychlý a chutný oběd je raz dva na stole', 1, 'Menší porce\n3\nporce\n\nVětší porce\n\n600 g brambor\n\n200 g kvalitní kuřecí šunky (nebo krůtí šunky)\n\nsůl\n\nmletý pepř\n\n2 velká vejce\n\n100 g eidamu (nebo čedaru)\n\n400 g růžičkové kapusty\n\n200 ml mléka\n\nchilli paprička (podle chuti)\n\n1/2 lžičky kari koření\n\nbylinky (podle chuti)\n\nBrambory oloupeme, nakrájíme na čtvrtky a uvaříme v osolené vodě do poloměkka. Poté je scedíme a necháme trochu vychladnout.\n\nZ kapustiček odřízneme košťál a zbavíme je svrchních lístků. Poté je přepůlíme a vhodíme do osolené vroucí vody. Vaříme 5 minut, poté je scedíme a okamžitě zchladíme v ledové vodě.\nTroubu zapneme a předehřejeme na 180 °C.\nJak blanšírovat zeleninu\n\nŠunku nakrájíme na drobné kostky. Brambory na kostky velikosti sousta. Sýr nastrouháme nahrubo. \n\nVejce rozšleháme pomocí vidličky v mléce, společně se solí a pepřem. Do zapékací misky vyložené pečicím papírem dáme brambory a kapustičky, dle chuti je osolíme a opepříme. Poté je promícháme se šunkou a kari kořením.', 'data:image/webp;base64,');
INSERT INTO `recipe` (`id`, `name`, `subtitle`, `user_id`, `text`, `image_base64`) VALUES
(4, 'Kakaové pohankové vafle s mangovým tvarohem', 'I vafle můžeme připravit ve zdravější verzi a vychutnat si tak sladkou snídani bez výčitek. Vafle připravíme z pohankové mouky a podáváme je ozdobené výborným mangovým tvarohem.', 1, '2 šálky pohankové mouky\n\n2 vejce\n\n1 lžička kypřicího prášku\n\n2 lžíce kakaa\n\nskořice (dle chuti)\n\n2 šálky mléka (může být i rostlinné)\n\nKrém:\n\n1 zralé mango\n\n250 g polotučného tvarohu\n\n2-3 lžíce skyru\n\n1-2 lžíce chia semínek\n\ntřtinový cukr (není nutné)\n\nV míse nejprve promícháme mouku, kakao, skořici a kypřicí prášek. Poté přidáme vejce a mléko a metličkou všechny suroviny promícháme. Vznikne těsto o něco hustší než palačinkové.\n\nZ těsta upečeme vafle ve vaflovači nebo silikonové formě na vafle.\nJak upéct vafle\n\n\nMango oloupeme a rozmixujeme ponorným mixérem dohladka. Pyré promícháme s tvarohem, skyrem a chia semínky. Podle chuti můžeme krém dosladit např. třtinový cukrem. Ideální je nechat krém odležet v lednici alespoň 1 hodinu nebo ještě lépe přes noc. \nJak správně oloupat mango\n\nVafle podáváme s mangovým tvarohem a ovocem, můžeme je také pokapat javorovým sirupem či posypat nastrouhanou vysokoprocentní čokoládou nebo nasekanými ořechy. ', 'data:image/webp;base64,');

